 manage ownership of your site.'=>'구글 사이트 확인은 사이트의 소유권을 관리하도록 합니다.','Unknown user.'=>'알 수 없는 이용자입니다.','Earn money by placing ads on your website. It’s free and easy.'=>'웹사이트에 광고를 배치하여 수익을 창출합니다. 무료이고 쉽습니다.','Invalid date range.'=>'유효하지 않은 자료 범위입니다.','Go to AdSense'=>'애드센스로 가기','AdSense account ID not set.'=>'애드센스 계정 ID를 설정하지 않았습니다.','https://tagmanager.google.com/'=>'https://tagmanager.google.com/','Tag Manager creates an easy to manage way to create tags on your site without updating code'=>'태그 관리자는 코드를 업데이트하지 않고 사이트에 태그를 만들수 있도록 쉽게 관리하는법을 만듭니다.','Google PageSpeed Insights gives you metrics about performance, accessibility, SEO and PWA'=>'구글 페이지스피드 인사이트는 성능, 접근성, SEO와 PWA에 대한 측정항목을 제공합니다.','Request parameter %1$s is not one of %2$s'=>'요청 매개 변수 %1$s(은)는 %2$s 중의 하나가 아닙니다','https://search.google.com/search-console'=>'https://search.google.com/search-console','Google Search Console and helps you understand how Google views your site and optimize its performance in search results.'=>'구글 검색 콘솔은 구글이 사이트를 어떻게 보고 검색 결과에서 사이트의 성능을 어떻게 최적화하는지에 대해 이해하도록 돕습니다.','Invalid datapoint.'=>'유효하지 않은 자료포인트입니다.','Error adding the site to Search Console.'=>'사이트를 검색 콘솔에 추가하는 중에 오류가 있습니다.','Request parameter is empty: %s.'=>'요청 매개변수가 비었습니다: %s.','Error Activating'=>'활성화 오류가 있습니다','https://opensource.google.com'=>'https://opensource.google.com','Google'=>'구글','Site Kit is a one-stop solution for WordPress users to use everything Google has to offer to make them successful on the web.'=>'사이트 킷은 구글이 웹을 성공적으로 만들어 주는 모든 것을 이용하는 워드프레스 이용자용 종합 해법입니다.','https://sitekit.withgoogle.com'=>'https://sitekit.withgoogle.com','Site Kit by Google'=>'구글이 만든 사이트 킷']];